#include<bits/stdc++.h>
using namespace std;
class Solution {
public:
    string minRemoveToMakeValid(string s) {
        ios_base::sync_with_stdio(false);
        vector<pair<char,int>> stk;
        for(int i=0; i<s.size(); i++){
            if(s[i]=='('){
                stk.push_back(make_pair(s[i],i));
            }
            else if(!stk.empty() && s[i]==')' && stk.at(stk.size()-1).first=='('){
                stk.pop_back();
            }
            else if(s[i]==')') stk.push_back(make_pair(s[i],i));
        }
        string res="";
        int k=0;
        for(int i=0;i<s.length();i++){
            if(k<stk.size() && stk[k].second==i){
                k++;                
            }
            else res+=s[i];
        }
        return res;
    }
};
